INSERT INTO `greenmates_moim` (`id`, `title`, `content`, `content_trans`, `status`, `time`, `head_cnt`, `created_at`, `updated_at`, `author_id`, `restaurant_id`) VALUES
	(13, '한 끼 어 때 ?', '점심 같이 먹어요~~', 'shivering', 2, '2022-05-19 13:30:00.000000', 2, '2022-05-18 15:28:58.950629', '2022-05-18 15:28:58.950648', 3, 18),
	(16, '메이트 평가 테스트용', '메이트 평가 테스트용', 'test', 3, '2022-05-17 02:36:58.000000', 2, '2022-05-17 02:37:01.000000', '2022-05-19 02:37:01.000000', 6, 287),
	(19, '점심 함께 해요', '토요일 점심 함께 먹어요!\n여기 후무스 김밥 맛있어요.\n함께 맛나게 식사해요.', 'Let\'s have lunch together on Friday!\nHumus gimbap is good here.\nLet\'s have a delicious meal together.', 0, '2022-05-21 11:30:00.000000', 4, '2022-05-19 11:50:24.953289', '2022-05-19 14:42:13.318272', 17, 53),
	(20, '인도음식 함께 시도해봐요', '인도음식 한번 시도해보고싶어요.\n함께 드실분??', 'I want to try Indian food.\nWho wants to eat it with me?', 0, '2022-05-20 18:50:00.000000', 3, '2022-05-19 11:55:25.589374', '2022-05-19 11:55:25.589395', 4, 757),
	(22, '오늘은 샐러드', '샐러드 먹어요!', 'Let\'s eat salad!', 2, '2022-05-22 18:20:00.000000', 2, '2022-05-19 12:02:14.995386', '2022-05-19 19:10:17.844751', 5, 18),
	(23, '파스타 먹으러 가요', '반얀트리 서울의 시그니처 레스토랑이에요.\n제철 식제료로 만든 맛있는 샐러드와 파스타 먹으러 가실분!!', 'It\'s a signature restaurant in Banyan Tree Seoul.\nWho wants to eat delicious salad and pasta made with seasonal ingredients?', 0, '2022-05-23 12:30:00.000000', 3, '2022-05-19 14:12:04.083858', '2022-05-19 14:12:04.083879', 13, 28),
	(24, '바지락칼국수♡', '쫄깃한 바지락 칼국수 같이 먹어요.', 'Let\'s eat chewy clam kalguksu together.', 0, '2022-05-25 12:40:00.000000', 2, '2022-05-19 14:19:09.422853', '2022-05-19 14:19:09.422873', 16, 694),
	(25, '두부좋아하시는분', '가지밥에 순두부 너무 맛있을거같아요ㅎㅎ\n점심에 만나서 함께 먹어요!', 'Eggplant rice and soft tofu stew sounds so goodHaha\nLet\'s meet at lunch and eat together!', 0, '2022-05-24 12:00:00.000000', 5, '2022-05-19 14:25:12.871621', '2022-05-19 14:25:12.871640', 12, 547),
	(26, '국수 호로록', '지난번에 물 막국수 먹어봤는데 자꾸 생각나는 맛입니다.', 'I tried water makguksu last time, and it\'s a taste that I keep thinking about.', 0, '2022-05-26 12:20:00.000000', 6, '2022-05-19 14:30:02.098930', '2022-05-19 14:30:02.098952', 14, 243),
	(27, '혜화역에서 점심드실분', '해외에 온 느낌 가득한 식당에서 함께 식사해요', 'Let\'s eat together at a restaurant that feels like we\'re overseas', 0, '2022-05-27 12:30:00.000000', 4, '2022-05-19 14:32:19.390181', '2022-05-19 14:32:19.390201', 15, 335),
	(28, '맛있는 비건 라자냐', '비건라자냐가 맛있는 곳입니다!! 함께 점심먹으러 가실분!!!!', 'Vegan lasagna is a delicious place! Who wants to go to lunch with me?', 0, '2022-05-28 13:30:00.000000', 3, '2022-05-19 14:37:51.256557', '2022-05-19 14:37:51.256577', 18, 126),
	(29, '아이엠 카페', '아이엠카페에서 아보카도밥이랑 오일파스타 먹어요.', 'I eat avocado rice and oil pasta at I.M cafe.', 3, '2022-05-19 15:30:00.000000', 3, '2022-05-19 15:15:15.133377', '2022-05-19 15:15:15.133398', 4, 761),
	(30, '안녕하세요', '죠샌드위치 가실분', 'Who wants to go to Joe\'s Sandwich?', 0, '2022-05-20 16:00:00.000000', 2, '2022-05-19 15:51:16.586502', '2022-05-19 15:51:16.586524', 1, 24),
	(31, '[시연용] 유저평가를 위한 모임', '유저 평가를 위해 생성하는 모임입니다.', 'A meeting that you create for user evaluation.', 3, '2022-05-19 16:45:00.000000', 8, '2022-05-19 16:27:44.331362', '2022-05-19 16:27:44.331381', 4, 694),
	(33, '[시연용] 타코 함께 먹어요!', '프로젝트 끝내고 맛나게 먹어요!', 'Finish the project and enjoy it!', 0, '2022-05-20 18:30:00.000000', 6, '2022-05-19 16:33:07.102141', '2022-05-19 16:33:07.102161', 4, 354),
	(34, '[시연용] 점심 함께해요!!', '함께 점심먹어요!', 'Let\'s have lunch together!', 1, '2022-05-20 12:00:00.000000', 4, '2022-05-19 16:36:38.487047', '2022-05-19 16:36:38.487065', 15, 333),
	(35, '[시연연습용] 점심함께먹어요!', '함께 점심먹어요.', 'Let\'s have lunch together.', 3, '2022-05-19 12:30:00.000000', 3, '2022-05-19 16:50:03.991881', '2022-05-19 16:50:03.991900', 14, 53),
